actionConfiguration.body:
() => {
  const peerId = PeerName.selectedOptionValue;
  const selfId = feedbackToName.selectedOptionValue;
  const categories = getKraCategories.data;
  const feedbacks = getFeedback.data.filter(fdbk => fdbk.from_employee == peerId && fdbk.feedback_type == "peer" && fdbk.cycle === feedbackObj.getDateForCycle() && fdbk.to_employee == selfId);
  const custCategories = categories.map(category => {
    const continueDoing = feedbacks.find(feedback => feedback.category === category.id)?.feedback_continue ?? "N/A";
    const canDo = feedbacks.find(feedback => feedback.category === category.id)?.feedback_more_of ?? "N/A";
    const rating = feedbacks.find(feedback => feedback.category === category.id)?.rating ?? 0;
    const feedbackid = feedbacks.find(feedback => feedback.category === category.id)?.id ?? 0;
    const cycle = feedbacks.find(feedback => feedback.category === category.id)?.cycle ?? "N/A";
    return {
      name: category.name,
      description: category.description,
      continueDoing: continueDoing,
      cando: canDo,
      rating: rating,
      id: category.id,
      feedbackid: feedbackid,
      cycle: cycle
    };
  });
  console.log("feedbacfeedbacksks", peerId, selfId, getFeedback.data, custCategories);
  return custCategories;
}

